    true,nt"url": null,nt"notes": "This report offers updated estimates of
    the number of people eligible for WIC benefits in 2011, including (1) estimates
    by participant category (including children by single year of age) and coverage
    rates; (2) updated estimates in U.S. territories; and (3) confidence intervals.
    The national estimates presented in this report are based on a methodology developed
    in 2003 by the Committee on National Statistics of the National Research Council
    (CNSTAT). The reportu2019s State-level estimates use a methodology developed by
    the Urban Institute that apportions the national figures using data from the American
